import React from "react";
import ReactDOM from "react-dom/client";
import "./style.css";
import one from "./assets/img/one.jpg";
import three from "./assets/img/three.jpg";
import two from "./assets/img/two.jpg";
// next level
import Navbar from "./components/navbar";
import Search from "./components/"


const root=ReactDOM.createRoot(document.getElementById("root"));


function Product() {
  return(
    <div className="products">
        <div className="box">
                <img src={one} alt=""/>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
            </div>
            <div className="box">
                <img src={three} alt="villain"/>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
            </div>
            <div className="box">
                <img src={two} alt="Designs Club"/>
                <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
            </div>

    </div>
  );
}
function About(){
  return(
    <div style={{textAlign:"center"}}>
    <div class="about" style={{marginTop:"10px",textAlign:"center"}}>
        <h1>About Us</h1>
        <p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from "de Finibus Bonorum et Malorum" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>
    </div>
    </div>
  );
}
function Footer(){
  return(

    <footer>

    <div class="contact">




        <h3>Contact</h3>
        <p style={{marginTop:"5px"}}>+91 3478631928 <br/>
            perfumy@gmail.com
        </p>

    </div>



